import React from "react";
import { Outlet,Navigate } from "react-router-dom";
import { useContext } from "react";
import AuthContext from "../../store/auth-context";

const AuthLayout = ()=>{
    const authCtx = useContext(AuthContext);
    
    return(
        <>
            {authCtx.isLoggedIn ? (
                <Navigate to="/" />
            ) : (
                <section>
                    <Outlet />
                </section>
            )

            }
        
        </>

    )
}
export default AuthLayout;
